import React, { Component } from "react";
import "./App.css";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import PageContent from "./containers/pageContent";
import LoginPage from "./containers/pages/loginPage";
import NewUserPage from "./containers/pages/newUserPage";
import PageNotFound from "./containers/pages/pageNotFound";

class App extends Component {
  render() {
    return (
      <div>
        <video autoPlay loop width="100vw" height="100vh" id={"bg-video"}>
          <source src="glassBackroundLoop.mp4" type="video/mp4" />
        </video>
        <Router>
          <Switch>
            <Route exact path="/login" component={LoginPage} />
            <Route exact path="/signup" component={NewUserPage} />
            <Route path="/" component={PageContent} />
            <Route component={PageNotFound} />
          </Switch>
        </Router>
      </div>
    );
  }
}

export default App;
